class AsyncTask{async doGet(t,o){let e=t;if(Object.keys(o).length>0){let t=Object.entries(o).map(([t,o])=>`${t}=${encodeURIComponent(o)}`).join("&");e=`${e}?${t}`}Log.d("doGet --> "+e);let n={method:"GET",mode:"cors",cache:config.cache,headers:{"Content-Type":"application/json"}};const a=await fetch(e,n);if(a.ok)return await a.json();throw new Error(a.status)}async doPost(t,o){let e=t,n={method:void 0!==o.id&&null!==o.id?"PUT":"POST",mode:"cors",cache:"no-cache",headers:{"Content-Type":"application/json"},body:JSON.stringify(o)};Log.d(e);const a=await fetch(e,n);if(a.ok)return await a.json();throw new Error(a.status)}async doImport(t){return Log.d("doImport : "+t),await import(t).then(t=>t)}}export{AsyncTask};